// Mengimpor React
import React from 'react';
// Mengimpor logo yang digunakan
import logo from './logo.svg';
// Mengimpor styling untuk aplikasi
import './App.css';
// Mengimpor halaman Home yang telah dibuat
import Home from './pages/Home';

// Komponen utama App
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Selamat datang di aplikasi React pertama saya!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Pelajari React
        </a>
      </header>

      {/* Menambahkan komponen Home di bawah header */}
      <Home />
    </div>
  );
}

export default App;
